const kmh = msg.payload.speedKnots * 1.852;
msg.payload.dateTime
const created_at = ~~(new Date().getTime()/1000);
const tst = ~~((new Date(msg.payload.dateTime)).getTime()/1000)

if (msg.payload.status === 'warning') {
    return
}

msg.payload = {
    _type: 'location',
    bs: 0,
    lat: msg.payload.lat,
    lon: msg.payload.lon,
    tst,
    vel: ~~kmh, // convert to int
    created_at,
    acc: 1, // required from HA
    tid: 'RUDY' // used to display initials
};

msg.topic = 'owntracks/vanpi/rudy'
msg.rate = (msg.payload.vel)
    ? 1000 * 30 // every 30 second while driving
    : 1000 * 60 * 10; // every 10 minutes standing still
return msg;

msg.payload = {
  "location": {
    "lat": msg.payload.attributes.latitude,
    "lng": msg.payload.attributes.longitude,
  },
  "accuracy": 0
}
msg.statusCode = 200
return msg;

flow.set('lat', msg.payload.lat * (msg.payload.latPole === 'N' ? 1 : -1) );
flow.set('lon', msg.payload.lon * (msg.payload.lonPole === 'E' ? 1 : -1) );
return msg;
